    false,nt"url": null,nt"notes": "This report summarizes bird banding results
    at Ninigret National Wildlife Refuge during the fall of 2011.  The Ninigret banding
    station opened nets on 19 August and closed them on 28 October for a total of 30
    days. We operated a total of 18 nets divided into two loops consisting of ten nets
    in the southern and northern half of the study area. We opened ten nets at a time
    and alternated loops daily. Daily net hours and the number of open nets varied depending
    on weather conditions, but typically nets were opened 20 minutes before sunrise
    and closed around 11:00 for four days per week. We ran the nets for a total of 1051.25
    net hours (one net open for 1 hour equals 1 net hour, rounded to the nearest quarter
    hour). Report includes total birds captured, capture rates, and species totals.",nt"license_title":
